import React from "react";
import logo from "../designFIles/IoT_Light.jpg";

export const LogInIndex = () => {
  return (
    <div className="container">
      <div className="logo">
        <img src={logo} alt="Logo" style={{ width: "200px", height: "auto" }} />
      </div>
    </div>
  );
};
